import React from 'react';
import Header from '../components/Header';

const Testo = () => {
    return (
        <div>
            <Header />
            <h1>스타일 월드컵 페이지</h1>
            <p>여기에 월드컵 관련 내용을 넣으세요.</p>
        </div>
    );
};

export default Testo;
